                        xStrictConformity := xStrictConformity,
                        dwCodepoint => tempNextChar,
                        usiByteLength => tempNextCharLength
                    )
                THEN
                    tempWildcardSearchOffset := tempWildcardSearchOffset + tempNextCharLength;

                    IF
