FuUtf16CharToDword := FALSE;
dwCodepoint := 0;
usiWordLength := 0;

IF udiStringLength = 0 THEN
    RETURN;
END_IF

tempChar1 := psInput^[0];

IF tempChar1 >= 16#D800 AND_THEN tempChar1 <= 16#DBFF THEN
    // Two word character
    IF udiStringLength < 2 THEN
        RETURN;
    END_IF

    tempChar2 := psInput^[1];

    IF NOT FuValidateUtf16BytesForLength2(tempChar1, tempChar2) THEN
        RETURN;
    END_IF

    FuUtf16CharToDword := TRUE;
    dwCodepoint := SHL(TO_DWORD(tempChar1), 10) + TO_DWORD(tempChar2) + TO_DWORD((16#10000 - SHL(16#D800, 10) - 16#DC00));
    usiWordLength := 2;
ELSIF (tempChar1 >= 0 AND_THEN tempChar1 <= 16#D7FF) OR_ELSE (tempChar1 >= 16#E000 AND_THEN tempChar1 <= 16#FFFF) THEN
    // One word character

    FuUtf16CharToDword := TRUE;
    dwCodepoint := TO_DWORD(tempChar1);
    usiWordLength := 1;
ELSE
    // Invalid leader word value
    RETURN;
END_IF

FuUtf8CharToDword := FALSE;
dwCodepoint := 0;
usiByteLength := 0;

IF udiStringLength = 0 THEN
    RETURN;
END_IF

tempChar1 := psInput^[0];

IF
    NOT xStrictConformity AND_THEN
    tempChar1 >= 160 AND_THEN
    tempChar1 <= 255 AND_THEN (
        udiStringLength = 1 OR_ELSE (
            udiStringLength > 1 AND_THEN NOT FuValidateUtf8BytesForLength2(tempChar1, psInput^[1])
        ) OR_ELSE (
            udiStringLength > 2 AND_THEN NOT FuValidateUtf8BytesForLength3(tempChar1, psInput^[1], psInput^[2])
        ) OR_ELSE (
            udiStringLength > 3 AND_THEN NOT FuValidateUtf8BytesForLength4(tempChar1, psInput^[1], psInput^[2], psInput^[3])
        )
    )
THEN
    // One byte character (ISO 8859-1 latin1)

    FuUtf8CharToDword := TRUE;
    dwCodepoint := TO_DWORD(tempChar1);
    usiByteLength := 1;
ELSIF tempChar1 >= 240 THEN
    // Four byte character
    IF udiStringLength < 4 THEN
        RETURN;
    END_IF

    tempChar2 := psInput^[1];
    tempChar3 := psInput^[2];
    tempChar4 := psInput^[3];

    IF NOT FuValidateUtf8BytesForLength4(tempChar1, tempChar2, tempChar3, tempChar4) THEN
        RETURN;
    END_IF

    FuUtf8CharToDword := TRUE;
    dwCodepoint := SHL((TO_DWORD(tempChar1) AND 16#07), 18) OR SHL((TO_DWORD(tempChar2) AND 16#3F), 12) OR SHL((TO_DWORD(tempChar3) AND 16#3F), 6) OR (TO_DWORD(tempChar4) AND 16#3F);
    usiByteLength := 4;
ELSIF tempChar1 >= 224 THEN
    // Three byte charater
    IF udiStringLength < 3 THEN
        RETURN;
    END_IF

    tempChar2 := psInput^[1];
    tempChar3 := psInput^[2];

    IF NOT FuValidateUtf8BytesForLength3(tempChar1, tempChar2, tempChar3) THEN
        RETURN;
    END_IF

    FuUtf8CharToDword := TRUE;
    dwCodepoint := SHL((TO_DWORD(tempChar1) AND 16#0F), 12) OR SHL((TO_DWORD(tempChar2) AND 16#3F), 6) OR (TO_DWORD(tempChar3) AND 16#3F);
    usiByteLength := 3;
ELSIF tempChar1 >= 194 THEN
    // Two byte character
    IF udiStringLength < 2 THEN
        RETURN;
    END_IF

    tempChar2 := psInput^[1];

    IF NOT FuValidateUtf8BytesForLength2(tempChar1, tempChar2) THEN
        RETURN;
    END_IF

    FuUtf8CharToDword := TRUE;
    dwCodepoint := SHL((TO_DWORD(tempChar1) AND 16#1F), 6) OR (TO_DWORD(tempChar2) AND 16#3F);
    usiByteLength := 2;
ELSIF tempChar1 >= 128 THEN
    // Invalid leader byte value
    RETURN;
ELSE
    // One byte character (ASCII)

    FuUtf8CharToDword := TRUE;
    dwCodepoint := TO_DWORD(tempChar1);
    usiByteLength := 1;
END_IF

IF bChar1 = 16#E0 THEN
    FuValidateUtf8BytesForLength3 := (bChar2 >= 16#A0 AND_THEN bChar2 <= 16#BF AND_THEN bChar3 >= 16#80 AND_THEN bChar3 <= 16#BF);
ELSIF bChar1 >= 16#E1 AND_THEN bChar1 <= 16#EC THEN
    FuValidateUtf8BytesForLength3 := (bChar2 >= 16#80 AND_THEN bChar2 <= 16#BF AND_THEN bChar3 >= 16#80 AND_THEN bChar3 <= 16#BF);
ELSIF bChar1 = 16#ED THEN
    FuValidateUtf8BytesForLength3 := (bChar2 >= 16#80 AND_THEN bChar2 <= 16#9F AND_THEN bChar3 >= 16#80 AND_THEN bChar3 <= 16#BF);
ELSIF bChar1 >= 16#EE AND_THEN bChar1 <= 16#EF THEN
    FuValidateUtf8BytesForLength3 := (bChar2 >= 16#80 AND_THEN bChar2 <= 16#BF AND_THEN bChar3 >= 16#80 AND_THEN bChar3 <= 16#BF);
ELSE
    FuValidateUtf8BytesForLength3 := FALSE;
END_IF

IF bChar1 = 16#F0 THEN
    FuValidateUtf8BytesForLength4 := (bChar2 >= 16#90 AND_THEN bChar2 <= 16#BF AND_THEN bChar3 >= 16#80 AND_THEN bChar3 <= 16#BF AND_THEN bChar4 >= 16#80 AND_THEN bChar4 <= 16#BF);
ELSIF bChar1 >= 16#F1 AND_THEN bChar1 <= 16#F3 THEN
    FuValidateUtf8BytesForLength4 := (bChar2 >= 16#80 AND_THEN bChar2 <= 16#BF AND_THEN bChar3 >= 16#80 AND_THEN bChar3 <= 16#BF AND_THEN bChar4 >= 16#80 AND_THEN bChar4 <= 16#BF);
ELSIF bChar1 = 16#F4 THEN
    FuValidateUtf8BytesForLength4 := (bChar2 >= 16#80 AND_THEN bChar2 <= 16#8F AND_THEN bChar3 >= 16#80 AND_THEN bChar3 <= 16#BF AND_THEN bChar4 >= 16#80 AND_THEN bChar4 <= 16#BF);
ELSE
    FuValidateUtf8BytesForLength4 := FALSE;
END_IF
